(45, 2, 1, 'Em Hát Ai Nghe? - Orange x Toann「Remix Version by 1 9 6 7」/ Audio Lyrics Video', 'emhatainghe,orange,1967remix', 'Em Hát Ai Nghe? - Orange x Toann「Remix Version by 1 9 6 7」/ Audio Lyrics Video<br/>Prod. by Toann<br/>Bên cấp phép<br/>\n[Merlin] BHMedia Inc. (thay mặt cho SOXO Beat 1 9 6 7)', '1rBtcB7rf9IYVmMmbXpEBm5mnFQkjCNMlW189PJm.jpg', 'music', 'Cỏ cây héo trong mơ màng\ncũng như em mà\nGiây phút em ngỡ ngàng\nHóa ra người chẳng từng thương lấy em :((\nPhải thêm biết bao thất vọng\nđể thôi hi vọng\nTrái tim người sẽ rung động \nLệ đắng\nDuyên tình đắng\nTrời mang khúc ca đau buồn\nTrút ngàn sầu muộn\nlâu rất lâu chưa tạnh \nHoa chưa tàn nhưng\nGió nỡ nào cuốn đi \nĐơn côi cô quạnh mình em với em \nBầu trời trót kéo mây đen \nĐứng trên niềm riêng em rối bời\nChỉ thấy cất lời xót thương \n\nĐK:\nLời em hát ai nghe liệu thấu chăng trong lòng những ?\nNhững nhớ thương em dành hết sao người chẳng thấy\nChẳng tin ...\nNày em ơi đừng nghĩ suy thêm nhiều khổ tâm\nĐừng để gió gieo vào đêm lạnh câm\nKhóc đi đừng ngần ngại mưa rơi\nỦi an cõi lòng tả tơii\n\nCuộc đời đành loạn để duyên kiếp em lỡ làng em ơi \nDù rằng đường tình không đưa em tới nơi em mong đợi \nThì đừng lo\nHoa vẫn sẽ nở sau cơn mưa mù', 21, '2022-04-06 06:12:48', '2022-04-06 06:12:48'),
(46, 2, 1, 'Như Chưa Từng Có Phút Lìa Xa Remix - Chân Tình (Quốc Duy Remix)', 'emhatainghe,orange,1967remix', '✈ Như Chưa Từng Có Phút Lìa Xa Remix - Chân Tình (Quốc Duy Remix) ​| NHẠC HOT TIK TOK', 'mKYiWzb1fpKEgHG5xlvXiEXCGRQWg72mHlJqrB0v.jpg', 'music', 'Mùa xuân vừa đến hoa về trên những bàn tay\nVà em vừa đến thay màu áo mới vì anh\nNguyện cho ngày tháng êm đềm như những sớm mai\nNhững nhọc nhằn chớm quen\nVẫn trong ngần mắt em đang nhìn về anh.\nVà anh lại nhớ những giờ em đứng chờ trông\nMột mình lặng lẽ ướt lạnh trong mưa vì anh\nTình yêu tìm thấy nguyên vẹn sau đêm bão giông\nGiữa hoang tàn lãng quên\nNơi cuối đường có em riêng chờ đợi anh.\nNhư chưa từng có những phút lìa xa\nGiấu gương mặt trên vai anh khóc òa\nNhững con đường anh đi rồi cũng đưa anh về bên em.\nNhư anh được sống giây phút đầu tiên\nCó em tận đến những giây cuối cùng\nSuốt cuộc đời em không quên chân tình dành hết cho anh.', 22, '2022-04-06 07:22:28', '2022-04-06 07:22:28');

